import React, { Component } from "react";
import { connect } from "react-redux";
import { MENU } from "../redux";

class Navbar extends Component {
  constructor(props) {
    super(props);

    this.openMenu = this.openMenu.bind(this);
  }
  openMenu() {
    console.log(this.props.menu);
    this.props.changeMenuState(true);
  }

  render() {
    return (
      <div className="Navbar">
        <div className="button">
          <div className="button__icon" onClick={this.openMenu}>
            <span className="button__icon__bar">&nbsp;</span>
            <span className="button__icon__bar">&nbsp;</span>
          </div>
          <span className="button__text">Menu</span>
        </div>
      </div>
    );
  }
}

//Obter Redux State
const mapStateToProps = function(state) {
  return {
    menu: state.menu
  };
};

//Mudar Redux State
const mapDispatchToProps = dispatch => {
  return {
    changeMenuState: menu => {
      dispatch(MENU(menu));
    }
  };
};

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Navbar);
